import React from 'react';

function Signup() {

	let name = '';

	const handleNameOnChange = (event) => {
		name = event.target.value;
		console.log('>>> name is ', name);
	};

	return (

		<div>
			<input
				type="text"
				onChange={handleNameOnChange}
				value={name}
				placeholder="Enter your name"/>
		</div>
	);

}

export default Signup;
